import React, { Component } from 'react'
import './Mystyle.css'
const tyle={
    color:'orange'
}
export class StyleSheet extends Component {
    render() {
        const classname=this.props.val;
        return (
            <div  className={`${classname} other`}>
               <h1> hello</h1>
               <h1 style={tyle}>why</h1>
            </div>
        )
    }
}

export default StyleSheet
